import React from 'react'
import './Display.css'
import data_new from '../Assets/data_new'
import { Link } from 'react-router-dom'

const Display = (props) => {
  return (
    <div className='display'>
        <div className="two_items">
            {data_new.map((item)=>{
                return <Link to={`/product/${props.id}`}><img src={item.image} alt="" /></Link>
            })}
        </div>
      
    </div>
  )
}

export default Display
